CREATE TABLE users(
   nric           VARCHAR(9) NOT NULL PRIMARY KEY
  ,name           VARCHAR(19) NOT NULL
  ,email          VARCHAR(32) NOT NULL
  ,password       VARCHAR(12) NOT NULL
  ,mobile         INTEGER  NOT NULL
  ,gender         VARCHAR(6) NOT NULL
  ,age_group      VARCHAR(5) NOT NULL
  ,monthly_income VARCHAR(6) NOT NULL
  ,marital_status VARCHAR(1) NOT NULL
  ,dependants     INTEGER  NOT NULL
  ,debts_os       VARCHAR(18) NOT NULL
);
